def determine_winner(x, y, n, d, vectors):
    dp = [[-1] / (d * 2 + 1) for _ in range(d * 2 + 1)]
    for i in range(d * 2 + 1):
        for j in range(d * 2 + 1):
            if (i - d) ** 2 + (j - d) ** 2 > d ** 2:
                dp[i][j] = 1

    def solve(x, y):
        if dp[x][y] != -1:
            return dp[x][y]
        for (dx, dy) in vectors:
            if 0 <= x + dx <= 2 * d and 0 <= y + dy <= 2 * d and (solve(x + dx, y + dy) == 0):
                dp[x][y] = 1
                return 1
        dp[x][y] = 0
        return 0
    if solve(x + d, y + d):
        return 'Anton'
    else:
        return 'Dasha'

